import React from 'react';
import styled from 'styled-components';
import { connect } from 'react-redux'
import * as ROUTES from '../../../constants/routes.js'

import NavItem from '../..Navigation'

const Nav = styled.nav`
  display: flex;
  margin-top: null;
`
const Ul = styled.ul`
  display: flex;
  align-items: center;
  height: 100%;
`

const MenuNavItems = ({ clicked, emailVerified }) => {
    let links

    if (emailVerified) {
        links = (
            <Ul>
                <NavItem clicked = {clicked} link = {ROUTES.HOME}> Home </NavItem>
                <NavItem clicked = {clicked} link = {ROUTES.PROFILE_EDIT}> Edit Profile </NavItem>
                <NavItem clicked = {clicked} link = {ROUTES.DISPLAY_FRIENDS}> Friends </NavItem>
                <NavItem clicked = {clicked} link = {ROUTES.ABOUT}> About </NavItem>
                <NavItem clicked = {clicked} link = {ROUTES.LOG_OUT}> Log Out </NavItem>
            </Ul>
        )
    } else {
        links = (
            <Ul>
                <NavItem clicked = {clicked} link = {ROUTES.ABOUT}> About </NavItem>
                <NavItem clicked = {clicked} link = {ROUTES.LOG_OUT}> Log Out </NavItem>
            </Ul>
        )
    }

    return <Nav>{ links }</Nav>
}

const mapStateToProps = ({ firebase }) => ({
    emailVerified: firebase.auth.emailVerified,
})

export default connect(mapStateToProps, null)(MenuNavItems)
